import Home from "./Scenes/Home/Home";
import SignIn from "./Scenes/SignIn/SignIn";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/SignIn" component={SignIn} />
      </Switch>
    </Router>
  );
}

